import "./App.css";
import { Users } from "./users";

function App() {
  return (
    <div className="app">
      <input type="text" placeholder="Search..." className="search" />
      <ul className="list">
        {Users.map((users) => (
          <li className="list-item">users</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
